text:
 @PedroAugusthus  Apenas opinião. Sim o Goianiense fez boas campanhas nas outras competições, porém isso foi fato predominante para a queda, já que, se tivesse concentrado todas as forças no Brasileirão, provável que não teria caído. Esse ano muitos times deram sopa pro azar.
Goiás sim, time de série A. Pra mim deveria subir só dois e caírem dois também. Premiaria da B, as melhores campanhas e evitaria muitos clubes que sobem e já caem novamente.
No mais é isso, bola pra frente.

 @leandrofarial7  Qual seu critério para falar time de série A e série B? Número de torcedores? 

O Dragão tem uma gestão sustentável muito boa, consegue fazer muito com pouco, se tivesse concentrado no Brasileirão estava entre os top 10 certamente. Esse time do dragão é superior o do Goias e todos sabem disso. Como você disse, fez a besteira de focar nesses outros torneios. 

Ano que vem tem tudo para subir, apesar que vão desmantelar todo o time.

 @leandrofarial7  O Goias é maior que o ACG, nunca neguei isso, mas isso não implica em dizer que o ACG não merece estar na série A, time que merece estar na série é time que joga bola de série A. 
O ACG atual tem bola para série A, nos últimos 10 jogos o ACG jogou de igual para igual com todos os times grandes, todos, alguns desses jogos perdeu por detalhe, displicência, mas estava dominando os jogos.
Time pequeno, sem folha salarial gigantesca, não tem elenco para disputar três torneios ao mesmo tempo. Isso ocasionou a queda do Dragão.

